import React, { useState } from 'react';
import styled from "styled-components";

function SearchPage() {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  const handleSearch = () => {
    // 검색 결과를 가져오는 로직을 작성하세요.
    // 예를 들어, 서버와 통신하여 검색 결과를 가져오는 API 호출 등을 수행할 수 있습니다.
    // 가져온 검색 결과는 setSearchResults()를 통해 상태를 업데이트하세요.
    // setSearchResults([...newResults]); // 예시: 가져온 검색 결과를 상태에 업데이트

    // 여기서는 간단하게 검색어와 검색 결과를 콘솔에 출력하는 예시를 제공합니다.
    console.log('검색어:', searchTerm);
    console.log('검색 결과:', searchResults);
  };

  return (
    <div>
      <input
        type="text"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
        placeholder="검색어를 입력하세요"
      />
      <button onClick={handleSearch}>검색</button>

      <div>
        {searchResults.map((result, index) => (
          <p key={index}>{result}</p>
        ))}
      </div>
    </div>
  );
}

export default SearchPage;
